import React, { useState, useEffect } from 'react';
import { Line } from 'react-chartjs-2';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
} from 'chart.js';

ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend
);

function App() {
  const [stockData, setStockData] = useState(null);

  useEffect(() => {
    // Simulating API call with dummy data
    const dummyData = {
      labels: ['Jan', 'Feb', 'Mar', 'Apr', 'May', 'Jun'],
      datasets: [
        {
          label: 'AAPL',
          data: [150, 155, 160, 165, 170, 175],
          borderColor: 'rgb(75, 192, 192)',
          tension: 0.1
        },
        {
          label: 'GOOGL',
          data: [2800, 2850, 2900, 2950, 3000, 3050],
          borderColor: 'rgb(255, 99, 132)',
          tension: 0.1
        }
      ]
    };

    setStockData(dummyData);
  }, []);

  return (
    <div className="App">
      <h1>Stock Price Comparison</h1>
      {stockData ? (
        <div style={{ width: '80%', margin: 'auto' }}>
          <Line 
            data={stockData}
            options={{
              responsive: true,
              plugins: {
                title: {
                  display: true,
                  text: 'AAPL vs GOOGL Stock Prices'
                }
              }
            }}
          />
        </div>
      ) : (
        <p>Loading...</p>
      )}
    </div>
  );
}

export default App;
